import React from "react";

import Layout from "../layout/Layout";

class Home extends React.Component {
	constructor(props: any) {
		super(props);
	}

	render() {
		return (
			<div>
				<Layout />
				Hello WOrld
			</div>
		);
	}
}

export default Home;
